function() {

	var n, wsa = new Array, alive = 0;

	for (n = 0; n < 8; n++) {

		var ws = new_ws(get_appropriate_ws_url(""), "lws-minimal");
		wsa.push(ws);
		try {
			ws.onopen = function() {
				document.getElementById("r").disabled = 0;
				alive++;
			};

			ws.onmessage = function got_packet(msg) {
				var n, s = "";

				ring[head] = msg.data + "\n";
				head = (head + 1) % 50;
				if (tail === head)
					tail = (tail + 1) % 50;

				n = tail;
				do {
					s = s + ring[n];
					n = (n + 1) % 50;
				} while (n !== head);

				document.getElementById("r").value = s; 
				document.getElementById("r").scrollTop =
					document.getElementById("r").scrollHeight;
			};

			ws.onclose = function(){
				alive--;
				if (alive === 0)
					document.getElementById("r").disabled = 1;
			};
		} catch(exception) {
			alert("<p>Error " + exception);  
		}
	}
}

