function lm_timer_handler(ev) {
	socket_lm.send(pending);
	pending="";
}

/* lws-mirror protocol */

var down = 0;
var no_last = 1;
var last_x = 0, last_y = 0;
var ctx;
var color = "#000000";
var lm_timer;

function ev_mousemove (ev) {
	var x, y;

	if (ev.offsetX) {
		x = ev.offsetX;
		y = ev.offsetY;
	} else {
		x = ev.layerX - offsetX;
		y = ev.layerY - offsetY;

	}

	if (!down)
		return;
	if (no_last) {
		no_last = 0;
		last_x = x;
		last_y = y;
		return;
	}
	pending = pending + "d " + color + " " + last_x + " " + last_y +
			" " + x + " " + y + ";";

	if (pending.length > 400) {
		socket_lm.send(pending);
		clearTimeout(lm_timer);
		pending = "";
	} else
		lm_timer = setTimeout(lm_timer_handler, 1);

	last_x = x;
	last_y = y;
}

function ev_mousedown (ev) {
	down = 1;
}

function ev_mouseup(ev) {
	down = 0;
	no_last = 1;
}


function ws_open_mirror()
{	
	socket_lm = new_ws(get_appropriate_ws_url("?mirror=" + mirror_name),
			"lws-mirror-protocol");
	try {
		socket_lm.onopen = function() {
			document.getElementById("wslm_statustd").style.backgroundColor =
																	"#40ff40";
			document.getElementById("wslm_status").innerHTML =
								" <b>websocket connection opened</b><br>" +
								san(socket_lm.extensions);
			lws_gray_out(false);
		};

		socket_lm.onmessage =function got_packet(msg) {
			j = msg.data.split(";");
			var f = 0;
			while (f < j.length - 1) {
				i = j[f].split(" ");
				if (i[0] === "d") {
					ctx.strokeStyle = i[1];
					ctx.beginPath();
					ctx.moveTo(+(i[2]), +(i[3]));
					ctx.lineTo(+(i[4]), +(i[5]));
					ctx.stroke();
				}
				if (i[0] === "c") {
					ctx.strokeStyle = i[1];
					ctx.beginPath();
					ctx.arc(+(i[2]), +(i[3]), +(i[4]), 0, Math.PI*2, true); 
					ctx.stroke();
				}

				f++;
			}
		};

		socket_lm.onclose = function(){
			document.getElementById("wslm_statustd").style.backgroundColor =
																	"#ff4040";
			document.getElementById("wslm_status").textContent =
											" websocket connection CLOSED ";
			lws_gray_out(true,{"zindex":"499"});
		};
	} catch(exception) {
		alert("<p>Error" + exception);  
	}

	var canvas = document.createElement("canvas");
	canvas.height = 300;
	canvas.width = 480;
	ctx = canvas.getContext("2d");

	document.getElementById("wslm_drawing").appendChild(canvas);

	canvas.addEventListener("mousemove", ev_mousemove, false);
	canvas.addEventListener("mousedown", ev_mousedown, false);
	canvas.addEventListener("mouseup", ev_mouseup, false);

	offsetX = offsetY = 0;
	element = canvas;
      if (element.offsetParent) {
        do {
          offsetX += element.offsetLeft;
          offsetY += element.offsetTop;
          element = element.offsetParent;
        } while (element);
      }
}

